import tkinter as tk
import os
import sys
import time
from tkinter import *
import tkinter.font as font
import base64
os.environ['CUDA_VISIBLE_DEVICES'] = '0'
import mss
import numpy as np
import cv2
from threading import Thread
def resource_path(relative_path):
    """ Get absolute path to resource, works for dev and for PyInstaller """
    if getattr(sys, 'frozen', False):
        base_path = sys._MEIPASS
    else:
        base_path = os.getcwd()
    return os.path.join(base_path, relative_path)



def capture():
    global condition
    monitor = {"top": 97, "left": 491, "width": 1000, "height": 1000}
    sct = mss.mss()
    fourcc= cv2.VideoWriter_fourcc(*'XVID')
    File_name=f'VIDEO RECORDED {str(NAME.get())} {time.strftime("%S-%H-%M-%d-%m-%y")}.avi'
    print(File_name)
    out = cv2.VideoWriter(File_name,fourcc,int(FPSSPBOX.get()),(1000,1000))
    while condition:
        msg1 = np.array(sct.grab(monitor))
        msg = cv2.cvtColor(msg1, cv2.COLOR_BGR2GRAY)
        gray_image = cv2.cvtColor(msg, cv2.COLOR_BGRA2BGR)
        print(time.ctime())
        print("\n",File_name,"\n")
        out.write(gray_image)
    out.release()
t1=Thread(target=capture)

def start_recording():
    global condition
    condition=True
    t1.start()
    NAME.config(state='disabled')
    FPSSPBOX.config(state='disabled')
    print("thread started")
    startCHARIOT_btn.config(text="REC",bg="orange2")

    
def stop_recording():
    global condition
    condition=False
    print("thread stopped")
    startCHARIOT_btn.config(text="START",bg="white")
    root.quit()
    sys.exit()

root = Tk()
root.config(bg ="black")

startCHARIOT_btn = Button(root, text = "START", bg ="gray",activebackground="GREEN",font =("Helvetica",10,"bold"),height = 2, width = 15, command = start_recording)
