STOP_CHARIOT_btn = Button(root, text = "STOP", bg ="gray",activebackground="RED",font =("Helvetica",10,"bold"),height = 2, width = 15, command = stop_recording)
STOP_CHARIOT_btn.grid(row = 0 , column= 1,padx = 10, pady = 10)

